import React from "react";

export default function Task()
{
    return <div className="container-fluid">
        <div class="row col-12 taskheader">
           <span>To do list - date</span>
        </div>
        <button class="btn btn-success button"><i class="fas fa-plus-circle fa-2x"></i></button>
    </div>
}
